import React, { useEffect } from 'react';
import Layout from './Layout';
import ConvertCSVToXLSX from '../components/tool/ConvertCSVToXLSX';


const Convert = () => {

  return (
    <Layout
      child = {<ConvertCSVToXLSX/>}
    />
  );
}

export default Convert;
